import React from "react";

export default function About() {
  return (
    <section id="about" className="p-5 bg-white dark:bg-gray-800 text-gray-900 dark:text-white">
      <h2 className="text-3xl font-bold mb-4">About Me</h2>
      <div className="w-32 h-32 bg-gray-300 dark:bg-gray-600 rounded-full flex items-center justify-center text-4xl font-bold mb-4 mx-auto">
        K
      </div>
      <p className="text-lg leading-relaxed">
        Hi, I'm <strong>Kashif</strong>. I'm a passionate Full Stack Developer who
        loves building web applications and exploring new technologies.
      </p>
    </section>
  );
}
